    questionnaire survey (Appendix 1) to a randomly chosen sample of registered commercial
    fishermen. The objectives of the questionnaire were to inquire of this specific
    user group where conflict areas occur, what the conflicts are perceived to be, and
    accidental mortality of sea otters in fishing gear (from 1980 thorough 1984). This
    information was requested to assist the Service in developing a management program
